function JobsPage() {
  const jobs = [
    {
      title: "job 1",
      description: "description 1",
      budget: 50,
    },
    {
      title: "job 2",
      description: "description 2",
      budget: 10,
    },
  ];

  function jobObjectToHTML(job) {
    return (
      <div>
        <p>{jobs.title}</p>
        <p>{jobs.description}</p>
        <p>{jobs.budget}</p>
      </div>
    );
  }

  return (
    <div>
      <h1 className="auth-title">Jobs</h1>
      <ul>
        <li>
          <div>
            <p></p>
            <p></p>
            <p></p>
          </div>
        </li>
        {jobs}
      </ul>
    </div>
  );
}

export default JobsPage;
